import React from "react";

const RegisterDevice = () => {
    return (

        <React.Fragment>
            <button type="text">Add Device</button>
            <label htmlFor="exampleInputName">Device Name</label>
            <input type="email" className="form-control" id="exampleInputName" aria-describedby="deviceName"
                   placeholder="Enter Your Sip username"/>
        </React.Fragment>
    )
};

export default RegisterDevice;
